    return (
        <div style={{"display":"flex"}}>
            <div style={{"margin-left":"20px"}}>
                <img style={{"max-width":"100px"}} src={product.imageLink}/>
            </div>
            <div style={{"margin-left":"20px"}}>{product.title}</div>
            <div style={{"margin-left":"20px"}}>{product.price/100}лв</div>
            <div></div>

        </div>
    );
};

